long int gcd(long int a, long int b)
{
  if ((a == 0) || (b == 0))
    return 0;

  if (a == b)
    return a;

  if (a > b)
    return gcd(a - b, b);

  return gcd(a, b - a);
}

long int lcm(long int a, long int b)
{
  return (a * b) / gcd(a, b);
}

