int maxsum = 0;
void treesum(struct treenode *ptr, int sum)
{
  if (ptr != NULL)
  {
    sum = sum + ptr->data;
    if ((ptr->left == NULL) && (ptr->right == NULL))
    {
      if (sum > maxsum)
        maxsum = sum;

    }

    treesum(ptr->left, sum);
    treesum(ptr->right, sum);
  }

}

void createtree(struct treenode *ptr, int **a, int n, int i, int j)
{
  if ((i < (n - 1)) && (j <= i))
  {
    ptr->left = (struct treenode *) malloc(sizeof(struct treenode));
    ptr->left->left = NULL;
    ptr->left->right = NULL;
    ptr->left->data = *((*((a + i) + 1)) + j);
    createtree(ptr->left, a, n, i + 1, j);
    ptr->right = (struct treenode *) malloc(sizeof(struct treenode));
    ptr->right->left = NULL;
    ptr->right->right = NULL;
    ptr->right->data = *((*((a + i) + 1)) + (j + 1));
    createtree(ptr->right, a, n, i + 1, j + 1);
  }

}

