int euclid(int x, int y)
{
  while (x != y)
  {
    if (x > y)
    {
      x = x - y;
    }
    else
    {
      y = y - x;
    }

  }

  return x;
}

int lcm(int a, int b)
{
  return (a * b) / euclid(a, b);
