void sort(int a[], int n, int m)
{
  int p = 0;
  if (m > n)
  {
    p = partation(a, n, m);
    sort(a, n, p - 1);
    sort(a, p + 1, m);
  }

}

int partation(int a[], int n, int m)
{
  int x = a[m];
  int h = n - 1;
  int k = 0;
  for (k = n; k <= (m - 1); k++)
  {
    if (a[k] <= x)
    {
      h = h + 1;
      swap(&a[h], &a[k]);
    }

  }

  swap(&a[h + 1], &a[m]);
  return h + 1;
}

void swap(int *a, int *b)
{
  int temp = 0;
  temp = *a;
  *a = *b;
  *b = temp;
}

