void merge(int a[], int st, int mid, int end)
{
  int i;
  int j;
  int k;
  int n = (mid - st) + 1;
  int m = end - mid;
  int l[n];
  int r[m];
  for (i = 0; i < n; i++)
    l[i] = a[st + i];

  for (j = 0; j < m; j++)
    r[j] = a[(mid + 1) + j];

  i = 0;
  j = 0;
  k = st;
  while ((i < n) && (j < m))
  {
    if (l[i] < r[j])
    {
      a[k] = l[i];
      i++;
      k++;
    }
    else
    {
      a[k] = r[j];
      j++;
      k++;
    }

  }

  while (i < n)
  {
    a[k] = l[i];
    k++;
    i++;
  }

  while (j < m)
  {
    a[k] = r[j];
    k++;
    j++;
  }

}

void sort(int a[], int st, int end)
{
  int mid;
  if (st < end)
  {
    mid = st + ((end - st) / 2);
    sort(a, st, mid);
    sort(a, mid + 1, end);
    merge(a, st, mid, end);
  }

}

