    return MEMO[i][j];
  }

  if ((MEMO[i + 1][j] == 0) && (MEMO[i + 1][j + 1] == 0))
    MEMO[i][j] = A[i][j] + max(sum(A, i + 1, j, MEMO, n), sum(A, i + 1, j + 1, MEMO, n));

  if ((MEMO[i + 1][j] != 0) && (MEMO[i + 1][j + 1] != 0))
    MEMO[i][j] = max(A[i][j] + MEMO[i + 1][j], A[i][j] + MEMO[i + 1][j + 1]);

  if (MEMO[i + 1][j] == 0)
    MEMO[i][j] = A[i][j] + max(sum(A, i + 1, j, MEMO, n), MEMO[i + 1][j + 1]);

  if (MEMO[i + 1][j + 1] == 0)
    MEMO[i][j] = A[i][j] + max(sum(A, i + 1, j + 1, MEMO, n), MEMO[i + 1][j + 1]);

  return MEMO[i][j];
}

